import Head from 'next/head';

const Layout = (props: { children: JSX.Element[] | JSX.Element }) => (
  <div>
    <Head>
      <title>Color viewer</title>
      <link
        rel="stylesheet"
        href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css"
      />
    </Head>
    {props.children}
  </div>
);

export default Layout;
